import React, { useState, useRef } from 'react'
import "./Video.css";

function Video() {
    const [play, setPlay] = useState(true);
    const vidRef = useRef(null);


    const handleVid = () => {
        if (play) {
            vidRef.current.pause();
            setPlay(false);
        }
        else {
            vidRef.current.play();
            setPlay(true);
        }
    }
    return (
        <div className="video">

            <video
                className="videoPlayer"
                onClick={handleVid}
                loop
                autoPlay
                src="https://v16m-us.tiktokcdn.com/e3544f55aa7a4f7afb1b78f9e04bcd7f/612da8b0/video/tos/useast2a/tos-useast2a-pve-0068/39d2303d79954e9b86f2b1974b67dfa0/?a=1233&br=1800&bt=900&cd=0%7C0%7C1&ch=0&cr=0&cs=0&cv=1&dr=0&ds=3&er=&ft=98Cx~eta4kag3&l=202108302157250101901860145D9452EC&lr=tiktok_m&mime_type=video_mp4&net=0&pl=0&qs=0&rc=anhuNzRmdDhyNjMzNzczM0ApaDQ8ZDw0O2Q3NzdlNjNkNGcvNWtiXmltL15gLS1kMTZzczUyYDY0NDEvXzQtLV8xNC46Yw%3D%3D&vl=&vr="
                type="video/mp4"
            >
            </video>
        </div>
    )
}

export default Video;
